What's the story?

The lovable Pipsqueak feels unappreciated by her young owner and is magically transported into the Zhu-niverse, where every creature is a form of hamster. She meets fellow Zhus Num Nums, Chunk, and Mr. Squiggles, who are told by Stinker -- the resident trouble-making skunk -- that if they find their way to the Palace of Zhu, an Oz-like Zhu Fu will grant all their wishes. When they arrive at the Palace -- after some close calls with menacing Zhus -- the friends discover that it's run by an evil snake villain called Mezhula. If the Zhu pals can't stop Mezhula, she'll use their &quot;Zhu power&quot; to fuel her nefarious plans.



